import React from 'react';

import './App.css';

import { Route,

  BrowserRouter as Router , 
  Switch} from 'react-router-dom'


 import Home from './Home/Home';
import Auth from './Auth/Auth';



function App() {
  return (
    <Router>
    <Switch>
      <Route exact path="/" component={Home}/>
    />
      <Route path="/auth" component={Auth} />
      }

    </Switch>
  </Router>
  );
}

export default App;
